import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Navbar.module.css';

const Navbar = () => {
  const navigate = useNavigate();

  const onPhotoTextClick = () => {
    // Define your navigation logic or other actions here
    // For example, navigate to a different route or perform some action
  };

  return (
    <div className={styles.navbar}>
      <div className={styles.crimewatch} onClick={() => navigate('/')}>crimewatch</div>
      <div className={styles.photo} onClick={onPhotoTextClick}>photo</div>
      <div className={styles.scraperWebsite} onClick={onPhotoTextClick}>
        <p className={styles.scraper}>scraper/</p>
        <p className={styles.scraper}>website</p>
      </div>
    </div>
  );
};

export default Navbar;
